select count(*) as aggregate from (select `bravo_cars`.* from `bravo_cars` where `bravo_cars`.`status` = 'publish' and ( '6371' * acos(
cos( radians('41.0370023') ) * cos( radians( map_lat ) ) * cos( radians( map_lng ) - radians('28.9850917') )
+ sin( radians('41.0370023') ) * sin( radians(map_lat) )
)
) <= '1' and `bravo_cars`.`deleted_at` is null group by `bravo_cars`.`id`) as `aggregate_table`

select `bravo_cars`.* from `bravo_cars` where `bravo_cars`.`status` = 'publish' and ( '6371' * acos(
cos( radians('41.0370023') ) * cos( radians( map_lat ) ) * cos( radians( map_lng ) - radians('28.9850917') )
+ sin( radians('41.0370023') ) * sin( radians(map_lat) )
)
) <= '1' and `bravo_cars`.`deleted_at` is null group by `bravo_cars`.`id` order by POW((bravo_cars.map_lng-28.9850917),2) + POW((bravo_cars.map_lat-41.0370023),2), `is_featured` desc, `id` desc limit 15 offset 0
